import React from 'react';
import Cards from '../projets/Cards';
import HeroSection from '../../organisms/header/HeroSection';
import Footer from '../../organisms/footer/Footer';
require('../../../App.css');
function Home() {
  return (
    <>
      <HeroSection />
      <video src='/videos/video-2.mp4' autoPlay loop muted />
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
